      return {
        ...state,
        callapidone: true
      };
    }

    case SUA_KHU_NHA: {
      return {
        ...state,
        callapidone: true
      }
    }

    case XOA_KHU_NHA: {
      return {
        ...state, 
        callapidone: true
      }
    }

    default:
      return state;
  }
}
